css:
atom-text-editor,
:host {
  background-color: #fafafa;
  color: #4d4d4c;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #fafafa;
  color: #717171;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f5f5f5;
  color: #4d4d4c;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #4d4d4c;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #dfdfdf;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #dfdfdf;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #dfdfdf;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #000000;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #000000;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #000000;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #d6d6d6;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: rgba(240, 240, 240, 0.5);
}
.comment {
  color: #8E908C;
  font-style: italic;
}
.keyword.operator.class,
.constant.other,
.source.php.embedded.line {
  color: #666969;
}
.string.other.link,
.string.regexp,
.entity.name.tag,
.entity.other.attribute-name,
.meta.tag,
.declaration.tag,
.markup.deleted.git_gutter {
  color: #b52a1d;
}
.variable,
.support.other.variable {
  color: #2e81ca;
}
.constant.numeric,
.constant.language,
.support.constant,
.constant.character,
.variable.parameter,
.punctuation.section.embedded,
.keyword.other.unit {
  color: #F5871F;
}
.entity.name.class,
.entity.name.type.class,
.support.type,
.support.class {
  color: #C99E00;
}
.string,
.constant.other.symbol,
.entity.other.inherited-class,
.entity.name.filename,
.markup.heading,
.markup.inserted.git_gutter {
  color: #718C00;
}
.keyword.operator,
.constant.other.color {
  color: #3E999F;
}
.entity.name.function,
.meta.function-call,
.support.function,
.keyword.other.special-method,
.meta.block-level,
.markup.changed.git_gutter {
  color: #4271AE;
}
.keyword,
.storage,
.storage.type {
  color: #8959A8;
}
.invalid {
  color: #FFFFFF;
  background-color: #C82829;
}
.meta.separator {
  color: #FFFFFF;
  background-color: #4271AE;
}
.invalid.deprecated {
  color: #FFFFFF;
  background-color: #8959A8;
}
.markup.inserted.diff,
.markup.deleted.diff,
.meta.diff.header.to-file,
.meta.diff.header.from-file {
  color: #FFFFFF;
}
.markup.inserted.diff,
.meta.diff.header.to-file {
  background-color: #718c00;
}
.markup.deleted.diff,
.meta.diff.header.from-file {
  background-color: #c82829;
}
.meta.diff.header.from-file,
.meta.diff.header.to-file {
  color: #FFFFFF;
  background-color: #4271ae;
}
.meta.diff.range {
  font-style: italic;
  color: #3e999f;
}
